import { Button, ButtonGroup } from "@material-ui/core";
import React from "react";

const Nav: React.FC = () => {
  return (
    <div>
      <nav className="navbar navbar-dark bg-dark">
        <ButtonGroup
          variant="contained"
          color="primary"
          aria-label="contained primary button group"
        >
          <Button>One</Button>
          <Button>Two</Button>
          <Button>Three</Button>
        </ButtonGroup>
      </nav>
    </div>
  );
};

export default Nav;
